int frames = 0;

void menuInit()
{
  for (uint8_t row = 0; row < ROWS_COUNT - 2; row++)
  {
    uint16_t * buffer = row % 2 == 0 ? buffer1 : buffer2;
    
    memcpy(buffer, TITLE_IMAGE[row], ROW_SIZE);
    
    if (row != 0) waitForPreviousDraw();
    
    drawScreenSlice(row * 16, 16, buffer);
  }

  waitForPreviousDraw();

  frames = 0;
}

void menuTick()
{
  if (gb.buttons.pressed(BUTTON_A))
  {
    startLevel(0);
  }
  else if (gb.buttons.pressed(BUTTON_B))
  {
    return;
  }
  else if (gb.buttons.pressed(BUTTON_MENU))
  {
    return;
  }

  memset(buffer1, 0x00, ROW_SIZE);
  memset(buffer2, 0x00, ROW_SIZE);

  if ((frames >> 6) % 2 == 0)
  {
    drawText(6, 4, "CREATED ON GAMEBUINO META", buffer1);
    drawText(6, 4, "- BY JICEHEL -- 01/2022 -", buffer2);
  }
  else
  {
    drawText(30, 4, "A: START GAME", buffer1);
    drawText(30, 4, "B: LEVEL SELECT", buffer2);
  }

  drawScreenSlice(6 * 16, 16, buffer1);
  waitForPreviousDraw();
  drawScreenSlice(7 * 16, 16, buffer2);
  waitForPreviousDraw();

  frames++;
}
